import React from "react";
import bgImg from '../../assets/images/miles-burke-idhx-MOCDSk-unsplash.jpg';
import PrimaryButton from "../Shared/PrimaryButton";

const Contact = () => {
  return (
    <div style={{
        background:`url(${bgImg})`
    }} className='bg-primary px-10 py-10 w-50 '>
      <div className='text-center pb-14 text-white'>
        <p className='text-xl font-bold text-transparent bg-clip-text bg-gradient-to-br from-accent to-secondary'>
          Contact Us
        </p>
        <h1 className='text-4xl'>Join the Power Letter</h1>
        <p>Sign up here to receive our timely product and company updates. </p>
      </div>
      
     
    
       
     <div className='grid grid-cols-1 justify-items-center gap-5'>
        <input
          type='text'
          placeholder='Email Address'
          className='input w-full max-w-md'
        />
        <input
          type='text'
          placeholder='Subject'
          className='input w-full max-w-md'
        />
        <textarea
          className='textarea w-full max-w-md'
          placeholder='Your message'
          rows={6}
        ></textarea>
        <PrimaryButton>Submit</PrimaryButton>
      </div>
     </div>
     
   
  );
};

export default Contact;
